const PersonalData = () => (
    <div className="container" id="datos">
        <h1>Datos Personales</h1>
        <ul>
            <li>Nombre</li>
            <li>Apellido</li>
            <li>Cedula</li>
            <li>Telefono</li>
            <li>Direccion</li>
            <li>Email</li>
        </ul>
    
            <style jsx> {`
            .container{
                border: 1px solid red;
                margin: 20px;
                text-decoration: none;
            }
            .container ul{
                text-decoration: none;
            }
            `}
            </style>
    </div>
);

export default PersonalData;
